import { Route, NavLink, HashRouter } from "react-router-dom";
import TableParameter2 from "./TableParameter2a";
import Table from "./Tablechallenge2";
import TableParameter from "./tablechallenge1";

class Main extends Component {
  render() {
    return (
      <div>
        <h1>Simple Navigation</h1>
        <ul className="header">
          <li>
            <a href="/TableParameter2a">TableParameter2</a>
          </li>
          <li>
            <a href="/Tablechallenge2">Table</a>
          </li>
          <li>
            <a href="/tablechallenge1">TableParameter</a>
          </li>
        </ul>
        <div className="content"></div>
      </div>
    );
  }
}

export default Main;
